INSERT INTO `nideshop_goods` VALUES (1181015, 1008008, '', 'TRzol（总 RNA 提取试剂）', 0, 0, 'trzol,RNA提取', 'TRzol（总 RNA 提取试剂）', '<p><strong>产品介绍：</strong></p><p><br></p><p>&nbsp;&nbsp;TRzol试剂是直接从细胞或组织中提取总RNA的试剂。它在破碎和溶解细胞时能保持RNA的完整性。加入氯仿后离心，样品分成水样层和有机层。RNA存在于水样层中。收集上面的的水样层后，RNA可以通过异丙醇沉淀来回收。</p><p><br></p><p>&nbsp;无论是人、动物、植物还是细菌组织，该方法对少量及大量的组织和细胞均有较好的分离效果。TRzol试剂操作上的简单性允许同时处理多个的样品。所有的操作可以在一小时内完成。TRzol抽提的总RNA能够避免DNA和蛋白的污染。故而能够做RNA印迹分析、斑点杂交、poly(A)+选择、体外转录、RNA酶保护分析和分子克隆。</p><p><br></p><p>&nbsp;TRzol试剂能促进不同种属不同分子量大小的多种RNA的析出。例如，从大鼠肝脏抽提的RNA通过琼脂糖凝胶电泳并用溴化乙锭染色，可见许多介于7 kb和15 kb之间不连续的高分子量条带(mRNA和hnRNA成分)，两条优势核糖体~5kb (28S)和~2kb(18S)，低分子量RNA介于0.1和0.3kb之间 (tRNA，5S)。当抽提的RNA用TE稀释时其A 260 /A 280 比值≥1.8。</p><p><br></p><p><br></p><p><br></p><p><strong>产品储存</strong>：TRzol在室温下能稳定保存12个月。尽管如此，为达到最佳效果，我们建议保存在2-8℃的环境下。</p><p><br></p><p><br></p><p class=\"ql-align-center\">（具体操作详见说明书）</p><p class=\"ql-indent-1\"><br></p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/a14c0ea0-00c1-4820-af33-9c700af9ef65.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/20698fe2-5c10-42cf-97f9-c2b525bfbb5d.jpg', 360.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 1, '');
INSERT INTO `nideshop_goods` VALUES (1181018, 1008008, '', 'TRzol LS（液体样本 RNA 提取试剂）', 0, 0, 'trzol,RNA提取', 'TRzol LS（液体样本 RNA 提取试剂）试剂盒', '<p class=\"ql-indent-1\">产品介绍：</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">&nbsp;TRzol LS试剂是直接从来源于人、动植物、酵母、细菌和病毒的液体样品中提取总RNA的试剂。它在破碎和溶解细胞时能保持RNA的完整性。加入氯仿后离心，样品分成水样层和有机层。收集上面的的水样层后，RNA可以通过异丙醇沉淀来回收。</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">无论是人、动物、植物还是细菌组织，该方法对少量及大量的组织和细胞均有较好的分离效果。TRzol LS试剂操作上的简单性允许同时处理多个的样品。所有的操作可以在一小时内完成。TRzol LS抽提的总RNA能够避免DNA和蛋白的污染。故而能够作RNA印迹分析、斑点杂交、poly(A)+选择、体外翻译、RNA酶保护分析和分子克隆。如果是用于PCR，当两条引物位于单一外显子内时，建议用扩增级的DNaseI来处理抽提的总RNA。</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">TRzol LS试剂能促进不同种属不同分子量大小的多种RNA的析出。例如，从大鼠肝脏抽提的RNA琼脂糖凝胶电泳并用溴化乙啶染色，可见许多介于7kb和15kb之间不连续的高分子量条带，两条优势核糖体-5kb (28S)和-2kb(18S)，低分子量RNA介于0.1和0.3 kb之间 (tRNA, 5S)。当抽提的RNA用TE稀释时其A260/A280比值≥1.8。</p><p class=\"ql-indent-1\"><br></p><p><br></p><p class=\"ql-indent-1\">产品储存：TRzol LS在室温下能稳定保存12个月。尽管如此，为达到最佳效果，我们建议保存在2~8°C的环境下。&nbsp;</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/df532248-49b3-4708-ace3-f8137b3968d5.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/796dcc1e-31ec-47e6-9e3b-f7273a4602b6.jpg', 690.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 1, '');
INSERT INTO `nideshop_goods` VALUES (1181019, 1008008, '', 'EASYspin 植物RNA快速提取试剂盒（DNase Ⅰ)', 0, 0, 'trzol,RNA提取', 'TRzol LS（液体样本 RNA 提取试剂）试剂盒', '<p class=\"ql-indent-1\">产品介绍：</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">&nbsp;TRzol LS试剂是直接从来源于人、动植物、酵母、细菌和病毒的液体样品中提取总RNA的试剂。它在破碎和溶解细胞时能保持RNA的完整性。加入氯仿后离心，样品分成水样层和有机层。收集上面的的水样层后，RNA可以通过异丙醇沉淀来回收。</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">无论是人、动物、植物还是细菌组织，该方法对少量及大量的组织和细胞均有较好的分离效果。TRzol LS试剂操作上的简单性允许同时处理多个的样品。所有的操作可以在一小时内完成。TRzol LS抽提的总RNA能够避免DNA和蛋白的污染。故而能够作RNA印迹分析、斑点杂交、poly(A)+选择、体外翻译、RNA酶保护分析和分子克隆。如果是用于PCR，当两条引物位于单一外显子内时，建议用扩增级的DNaseI来处理抽提的总RNA。</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\">TRzol LS试剂能促进不同种属不同分子量大小的多种RNA的析出。例如，从大鼠肝脏抽提的RNA琼脂糖凝胶电泳并用溴化乙啶染色，可见许多介于7kb和15kb之间不连续的高分子量条带，两条优势核糖体-5kb (28S)和-2kb(18S)，低分子量RNA介于0.1和0.3 kb之间 (tRNA, 5S)。当抽提的RNA用TE稀释时其A260/A280比值≥1.8。</p><p class=\"ql-indent-1\"><br></p><p><br></p><p class=\"ql-indent-1\">产品储存：TRzol LS在室温下能稳定保存12个月。尽管如此，为达到最佳效果，我们建议保存在2~8°C的环境下。&nbsp;</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/a54c44bb-8f03-426f-8d60-15e1e26627b4.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/3f07850e-6d9f-4a12-83a9-c093c94779e5.jpg', 0.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181020, 1008008, '', 'EASYspin组织/细胞RNA快速提取试剂盒（Dnase I）', 0, 0, 'EASYspin,组织RNA提取', 'EASYspin组织/细胞RNA快速提取试剂盒（Dnase I）', '<p><br></p><p><strong>产品介绍：</strong></p><p><br></p><p>&nbsp;独特的裂解液/β-巯基乙醇迅速裂解细胞和灭活细胞RNA酶，然后用乙醇调节结合条件后,RNA在高离序盐状态下选择性吸附于离心柱内硅基质膜，再通过一系列快速的漂洗－离心的步骤, 去蛋白液和漂洗液将细胞代谢物，蛋白等杂质去除，最后低盐的RNase free H20将纯净RNA从硅基质膜上洗脱。</p><p><br></p><p><br></p><p><strong>产品特点：</strong></p><p><br></p><p>1.重复性好，离心吸附柱内硅基质膜全部采用进口特制吸附膜，柱与柱之间吸附量差异极小。</p><p><br></p><p>2.操作安全，不需要使用有毒的苯酚，氯仿等试剂，也不需要乙醇沉淀等步骤。</p><p><br></p><p>3.简便快捷，单个样品操作一般可在30分钟内完成。&nbsp;</p><p><br></p><p><br></p><p><br></p><p><strong>产品储存</strong>:本试剂盒在室温储存12个月不影响使用效果。&nbsp;</p><p><br></p><p><br></p><p><br></p><p><strong>自备试剂</strong>:β-巯基乙醇、无水乙醇（Dnase I）</p><p class=\"ql-indent-1\"><br></p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/0d0b729b-7fb2-4429-a1b2-cf5109a11198.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/78786c5f-24a8-4e4c-9abf-9bcab0164630.jpg', 1090.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181021, 1008008, '', 'EASYspin全血RNA快速提取试剂盒（Dnase I）', 0, 0, 'EASYspin,RNA提取', 'EASYspin全血RNA快速提取试剂盒（Dnase I）', '<p><strong>产品介绍：</strong></p><p><br></p><p>&nbsp;&nbsp;红细胞裂解液选择性裂解红细胞,然后独特的裂解液/β-巯基乙醇迅速裂解白细胞和灭活细胞RNA酶，然后用乙醇调节结合条件后,RNA在高离序盐状态下选择性吸附于离心柱内硅基质膜，再通过一系列快速的漂洗－离心的步骤, 去蛋白液和漂洗液将细胞代谢物，蛋白等杂质去除，最后低盐的RNase free H20将RNA从硅基质膜上洗脱。</p><p><br></p><p><br></p><p><strong>产品特点：</strong></p><p><br></p><p>1.重复性好，柱与柱之间吸附量差异极小。克服了国产试剂盒膜质量不稳定的弊端。</p><p><br></p><p>2.操作安全，不需要使用有毒的苯酚，氯仿等试剂，也不需要乙醇沉淀等步骤.</p><p><br></p><p>3.简便快捷，单个样品操作一般可在40分钟内完成。&nbsp;</p><p><br></p><p><br></p><p><br></p><p><strong>产品储存:</strong>本试剂盒在规定保存温度储存12个月不影响使用效果。</p><p><br></p><p><br></p><p><strong>自备试剂</strong>:β-巯基乙醇、无水乙醇</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/b6629b0b-e2ce-4404-9a50-f99e98e32b22.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/e8a1daab-e4a2-4cc6-bcbc-1933b10c4463.jpg', 1190.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181022, 1008008, '', 'RNApure 超纯总 RNA 快速提取试剂盒 (DNase I)', 0, 0, 'RNApure,RNA提取', 'RNApure 超纯总 RNA 快速提取试剂盒 (DNase I)', '<p><strong>产品介绍：</strong></p><p><br></p><p><br></p><p>&nbsp;&nbsp;&nbsp;改进的异硫氰酸胍/酚一步法裂解细胞和灭活RNA 酶，然后总RNA在高离序盐状态下选择性吸附于离心柱内硅基质膜，再通过一系列快速的漂洗－离心的步骤, 去蛋白液和漂洗液将细胞代谢物、蛋白等杂质去除，最后低盐的RNase free water将纯净RNA从硅基质膜上洗脱。</p><p><br></p><p><br></p><p><br></p><p><strong>产品特点：</strong></p><p><br></p><p>1.离心吸附柱内硅基质膜全部采用进口世界著名公司特制吸附膜，柱与柱之间吸附量差异极小，可重复性好。克服了国产试剂盒膜质量不稳定的弊端。</p><p><br></p><p>2.结合了异硫氰酸胍/酚一步法试剂稳定性好，纯度高和离心柱方便快捷的优点，RNA可以直接从离心柱上洗脱避免了过度干燥不易溶解问题。</p><p><br></p><p>3.独有的RL裂解液配方，可以有效的消除基因组污染。</p><p><br></p><p>4.有效的去除了5S在总RNA中含量，提高了纯度。</p><p><br></p><p><br></p><p><br></p><p><strong>产品储存：</strong>本产品收到后按照上面指示温度存放各成份，储存12个月不影响使用效果。&nbsp;</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/b7a83a18-a409-48a1-a18f-02bdf2e9c53f.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/d6892f02-93e1-43e3-8998-f8dbe7782f03.jpg', 440.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181046, 1020003, '', 'Ni-IDA MagAgarose Beads琼脂糖磁珠', 0, 0, '琼脂糖磁珠,镍柱', 'Ni-IDA琼脂糖磁珠可用于简单、快速地小量提取组氨酸标签蛋白。磁珠与表达组氨酸标签蛋白的细胞裂解液混合，使用磁分离方法，通过结合、洗涤和洗脱等步骤就可以纯化出目的蛋白。', '<p><strong style=\"background-color: rgb(217, 217, 217);\">产品介绍：</strong></p><p>	Ni-IDA琼脂糖磁珠可用于简单、快速地小量提取组氨酸标签蛋白。磁珠与表达组氨酸标签蛋白的细胞裂解液混合，使用磁分离方法，通过结合、洗涤和洗脱等步骤就可以纯化出目的蛋白。与传统层析方式使用的金属螯合琼脂糖柱材相比，采用磁珠纯化组氨酸标签蛋白，无需控制流速。无需昂贵的层析设备。样品与磁珠的特异性结合、洗涤以及目标蛋白的洗脱变得简单、快速、易操作。在一小时内便能获得高纯度的目标蛋白，且能轻松实现高通量和大规模样品的平行处理。</p><p><br></p><p><strong style=\"background-color: rgb(217, 217, 217);\">自备器材和试剂：</strong>磁力架，带组氨酸标签的重组蛋白，缓冲液，摇床或旋转混合仪。</p><p><br></p><p><strong style=\"background-color: rgb(217, 217, 217);\">适用范围：</strong>用于纯化细菌、酵母、昆虫和哺乳动物细胞等系统表达的可溶性组氨酸标签蛋白，也可用于变性蛋白的纯化（包涵体蛋白需在变性条件下进行）。</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 1, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/2394d7f5-72ac-4e9b-aa2d-1a9f8b3dd628.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/3c75da0b-ba36-475f-9bd4-c96b35be530d.jpg', 580.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181063, 1008001, '', 'Stable 感受态细胞', 0, 0, '感受态,Stable感受态', '本公司生产的Stable感受态细胞是采用Stable菌株经特殊工艺制备得到的感受态细胞。Stable菌株特别适用于具有末端重复序列的逆转录病毒或慢病毒质粒的构建和扩增，也适用于重复DNA序列的克隆和扩增。', '<p><strong style=\"background-color: rgb(216, 216, 216);\">储存条件：</strong>-70℃保存，避免反复冻融。不适合在液氮中保存。</p><p><br></p><p><br></p><p><strong style=\"background-color: rgb(216, 216, 216);\">产品介绍：</strong></p><p><br></p><p>本公司生产的Stable感受态细胞是采用Stable菌株经特殊工艺制备得到的感受态细胞。Stable菌株特别适用于具有末端重复序列的逆转录病毒或慢病毒质粒的构建和扩增，也适用于重复DNA序列的克隆和扩增。Stable具有与Stbl3和Stbl4完全不同的基因型，比Stbl3和Stbl4生长速度更快，性能更好。核酸内切酶 (endA1)基因的缺失有利于提高质粒DNA的产量和质量。ΔlacZM15基因的存在可用于蓝白斑筛选。菌株还具有抗T1噬菌体感染的特点。Stable感受态细胞经pUC19质粒检测转化效率&gt;108 cfu/μg DNA。</p><p><br></p><p><br></p><p><strong style=\"background-color: rgb(216, 216, 216);\">基因型：</strong></p><p><br></p><p>F´ proA+B+ lacIq Δ(lacZ)M15 zzf::Tn10 (TetR)/Δ(ara-leu) 7697 araD139 fhuA ΔlacX74 galK16 galE15</p><p><br></p><p>e14- f80dlacZΔM15 recA1 relA1 endA1 nupG rpsL (StrR) rph spoT1 Δ(mrr-hsdRMS-mcrBC)</p><p><br></p><p><br></p><p><br></p><p><strong style=\"background-color: rgb(216, 216, 216);\">菌株抗性：</strong>对氨苄青霉素、氯霉素、卡那霉素、壮观霉素和呋喃妥因敏感。具有四环素和链霉素抗性。</p><p><br></p>', 0, 0, 100, 0, 0, 0.00, 0.00, 1, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/34d24cdc-9b0c-47af-8327-28c58f78048e.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/e0a63f11-37e5-40d7-8f71-6aa14dfa9ea1.jpg', 420.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181064, 1008001, '', 'TOP10 感受态细胞', 0, 0, '感受态,TOP10', '本公司生产的TOP10感受态细胞是采用大肠杆菌TOP10菌株经特殊工艺处理得到的感受态细胞，可用于DNA的化学转化。', '<p><strong style=\"background-color: rgb(216, 216, 216);\">储存条件：</strong>-70℃保存，避免反复冻融。</p><p><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(216, 216, 216);\">产品介绍：</strong></p><p class=\"ql-align-justify\">本公司生产的TOP10感受态细胞是采用大肠杆菌TOP10菌株经特殊工艺处理得到的感受态细胞，可用于DNA的化学转化。使用pUC19质粒检测，转化效率可达10<sup>8&nbsp;</sup>cfu/µg，-70℃保存几个月转化效率不发生改变。每支感受态可以酌情分装使用，降低了实验的成本。质量稳定，使用方便，质优价廉。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(216, 216, 216);\">基因型：</strong></p><p class=\"ql-align-justify\"><em>F-mcrAΔ(mrr-hsdRMS-mcrBC)φ80lacZΔM15ΔlacX74recA1araΔ139Δ(ara-leu)7697galUgalKrpsL(str</em><sup><em>R</em></sup><em>)endA1nupG</em></p><p class=\"ql-align-justify\"><br></p><p><strong style=\"background-color: rgb(216, 216, 216);\">产品特点：</strong></p><p class=\"ql-align-justify\">一种用于铺制与培养质粒平板和粘粒平板的重级缺陷的抑制型株。其φ80 lacZΔM15基因的产物可与pUC载体编码的β-半乳糖苷酶氨基端实现α互补，可用于蓝白斑筛选。</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong style=\"background-color: rgb(216, 216, 216);\">抗生素耐药性：</strong>细胞具有链霉素抗性。</p><p><br></p><p class=\"ql-align-center\"><span style=\"color: rgb(153, 153, 153);\">（具体操作详见说明书）</span></p>', 0, 0, 100, 0, 0, 0.00, 0.00, 0, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/534b4137-210b-4495-b0a8-bc9466b7d68d.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/799fffd6-fc2b-4f86-9205-bd17bfe5fc02.jpg', 170.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 1, '');
INSERT INTO `nideshop_goods` VALUES (1181067, 1007000, '', '1×Plant Direct PCR MasterMix', 0, 0, '植物扩增,PCR', '1×植物直接扩增PCR MasterMix 含有聚合酶、dNTPs和PCR 反应所需的缓冲液，是一种即用型PCR 扩增试剂使用时，只需加入引物和直径为0.5-1mm大小的叶片进行直接PCR 扩增。', '<p><strong style=\"background-color: rgb(217, 217, 217);\">储存条件：</strong>-20℃保存，有效期两年。</p><p><br></p><p><strong style=\"background-color: rgb(217, 217, 217);\">产品介绍：</strong></p><p>1×植物直接扩增PCR&nbsp;MasterMix&nbsp;含有聚合酶、dNTPs和PCR&nbsp;反应所需的缓冲液，是一种即用型PCR&nbsp;扩增试剂使用时，只需加入引物和直径为0.5-1mm大小的叶片进行直接PCR&nbsp;扩增。本产品可以直接使用微量植物叶片（如：水稻、小麦、烟草、玉米、大豆、油菜和西红柿等，叶片长度0.5-1mm见方）进行PCR反应，该PCR预混匀具有很强的扩增能力。该PCR&nbsp;预混液能节省实验时间，避免了常规PCR&nbsp;试剂多次加样造成的实验污染。预混液本身含有染料，扩增完成后可直接上样，进行电泳检测。</p><p><br></p><p><strong style=\"background-color: rgb(217, 217, 217);\">产品应用:</strong></p><p>试剂盒可用于以下用途：转基因植株鉴定、植物基因分型等。</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 1, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/0a555588-a5ad-49c6-a843-f7614058bd26.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/141d5c74-39a7-4dcf-bf94-312b6fe01813.jpg', 120.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181068, 1015001, '', 'EasyMut gene multisite mutagenesis kit（多点突变试剂盒）', 0, 0, ' 无缝克隆,点突变', 'EasyMut基因多点突变试剂盒利用无缝克隆技术来实现基因的定点突变，可用于单点突变和多点突变质粒的构建。', '<p><strong style=\"background-color: rgb(217, 217, 217);\">产品储存：</strong>请按产品指示温度保存各成分</p><p><strong>&nbsp;</strong></p><p><strong style=\"background-color: rgb(217, 217, 217);\">产品介绍：</strong></p><p>本产品利用无缝克隆技术来实现基因的定点突变，可用于单点突变和多点突变质粒的构建。本产品无需除去甲基化模板质粒，无需PCR扩增出整个质粒，并且引物设计更加简便快速，因此可以更加快速，高效地实现定点突变。</p><p>&nbsp;</p><p><strong style=\"background-color: rgb(217, 217, 217);\">产品特点：</strong></p><p>1.&nbsp;利用2×Xerox PCR Master Mix扩增片段，缩短扩增时间（2-4 kb/min），提高保真性；</p><p>2.&nbsp;引物设计更加简单，快速；</p><p>3.&nbsp;省略消化甲基化模板质粒的步骤，更加快速，高效；</p><p>4.&nbsp;无需PCR扩增出整个质粒，减少载体的突变。</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 1, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/74714d27-299d-429f-88ae-eab143d34098.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/eb750570-77da-4fbc-8d82-51122febe9a1.jpg', 1800.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
INSERT INTO `nideshop_goods` VALUES (1181074, 1008012, '', 'M-MLV 4 Reverse Transcriptase(200U/ul)', 0, 0, '反转录', 'M-MLV 4 Reverse Transcriptase(200U/ul)是通过基因重组技术改造，在大肠杆菌中表达纯化得到的高温反转录酶，去除RNaseH活性。', '<p><strong style=\"background-color: rgb(217, 217, 217);\">储存条件：</strong><strong>-</strong>20℃保存两年。</p><p><br></p><p><strong style=\"background-color: rgb(217, 217, 217);\">制品说明：</strong></p><p>本制品是通过基因重组技术改造，在大肠杆菌中表达纯化得到的高温反转录酶，去除RNaseH活性。该酶可在42℃-65℃条件下合成第一链cDNA，具有灵敏度高，特异性高，热稳定性高和半衰期长的特点。聚合能力强，具有更强的延伸能力，可用于较长的cDNA合成以及高比例的全长cDNA文库的构建等。</p><p><br></p><p><strong style=\"background-color: rgb(217, 217, 217);\">适用范围：</strong>第一链cDNA合成。可用高拷贝、低拷贝基因的检测。</p><p><br></p><p>（具体操作详情见说明书）</p>', 0, 0, 100, 0, 0, 0.00, 0.00, 1, NULL, 'https://www.wangcong.fun:8002/static/upload/brand/afcb1d64-17cf-44c3-a131-bca1cd0cd4fc.jpg', 'https://www.wangcong.fun:8002/static/upload/brand/a637f191-8816-4f36-9c69-222306b0c484.jpg', 350.00, 0, 0, 0.00, NULL, NULL, NULL, NULL, NULL, 0, '');
